import React, {Component} from "react";

import './Home.css';

class Home extends Component {
    render() {
        return (
            <div className = "container">
                <div className = "background">
                    <div className="title">Cacao & Beyond</div>
                    <div className="subtitle">Inventory System</div>
                </div>
            </div>
        );
    }
}

export default Home;
